import React from "react";
import "../styles/navbar.css";
const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="logo">
        <img
          src={"https://uidai.gov.in/images/logo/aadhaar_english_logo.svg"}
          alt=""
          style={{
            marginLeft: "0px",
            width: "60px",
            height: "60px",
            borderRadius: "50%",
          }}
        />
        <span style={{ textAlign: "center", color: "#686868" }}>IIT GOA</span>
      </div>
      <ul className="links">
        <li className="link">
          <span className="linkName"> My requests</span>
        </li>
        <li className="link">
          <span className="linkName"> Received requests</span>
        </li>
        <li className="link">
          <span className="linkName"> My requests</span>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
